  render() {
    const { comments, postId } = this.props;

    return comments.map(comment => (
        // <CommentItem />
        <CommentItem key={comment._id} comment={comment}  />

    ));
  }
}

CommentFeed.propTypes = {
  comments: PropTypes.array.isRequired,
};

export default CommentFeed;
